import React from 'react'
import { Scards } from '../../SCards/Scards'
import './Style/science.css'
import { data } from '../../SCards/DataSCARDS'

Scard

const Science = () => {
    return(
        <>
            <div className="Body" id='SBODY'>
                <Scards head={data[0].head}/>
                {data.map(Scard)}
            </div>
        </>
    )
}

export { Science }
